  \"2016-11-18T16:40:08.997329\",\n\t\"name\": \"boise-parking-zones-open-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The parking zone data set was developed
  for the Parking Services Division of the Finance and Administration Department for
  general mapping purposes and online mapping software to identify the parking zones
  administrated by the City of Boise. This data set should only be used for general
  information and cannot be used to contest signage on the ground. This data set bears
  similarities to the Parking Services Districts data set. The Parking Services Districts
  data set outlines the administrative boundaries of districts where parking control
  is enforced, while the Parking Zones data set identifies the curbside parking available
  within the control districts. This is a line data set representing the location
  of on-street (a.k.a. curbside) parking for the downtown and the mixed use, high
  impact residential areas of Boise City. Parking zones are established to regulate
  parking as to reduce negative impacts to residents, businesses, and traffic due
  to high vehicle density; in accordance with the provisions of the Boise City Code
  Chapter 10. The data set includes the location of accessible parking, motorcycle
  parking, timed parking, metered parking, loading zones, bus stops, and police parking
  zones. The dataset does not identify parking garages, parking lots, or other parking
  facilities. The data set identifies the type of parking zones, maximum time duration,
  and category (general parking zone, residential time zone, or special parking district
  zone). Every effort is made to keep this data accurate, however, positional and
  attribute accuracy as well as completeness and currentness for this data set cannot
  be guaranteed. The public should always obey the signs, signals, marking, and devices
  on the ground regardless of the content of this data set. This data set is maintained
  by Boise City IT GIS for the Parking Services Division of the Finance \",\n\t\"license_title\":
